import React from "react";
import './HomeComponent.css';


function HomeComponent() {
  return (
		<div className="home__component">
			<section className="abroad__title">
				<h2 className="head__title">Mbbs In Abroad</h2>
			</section>
		</div>
	);
}

export default HomeComponent;
